var y=0,x=0,s=0,v=0,h=0

function setup() {
	createCanvas(windowWidth, windowHeight)
	genRandom()
}

function draw() {
	x += v
	if(x > width+s){
	    x = -s
	}

	if(x < -s/2){
	    genRandom()
	}
	fill(255)
	ellipse(x, y+sin(frameCount/10)*h, s)
}

function genRandom(){
    y = random(height)
	s = random(20, 200)
    v = s/20
    h = random(v, v*10)
}

/*	easeFunction // cc teddavis.org 2019	*/

var x=0, y=0, e=0.05;

function setup() {
	createCanvas(windowWidth, windowHeight);
	fill(255);
}

function draw() {
	background(200);

	// built-in ease(inVal, outVal, easeVal) for smoothing values
	x = ease(mouseX, x, e);
	y = ease(mouseY, y, e);

	ellipse(x, y, 150, 150);
	text(nf(x, 3,1) + " / " + nf(y, 3,1), 0, height);

}

/*	sinStrings // cc teddavis.org 2019	*/

function setup() {
	createCanvas(windowWidth, windowHeight);
	mouseX = width * 0.4;
	pixelDensity(1);
}

function draw() {
	background(200);
	var lc = 40;
	fill(0);
	for(var i = 0; i < lc; i++) {
		var s = width / lc;
		var x = map(i, 0, lc - 1, 0, width);
		var osc = sin((frameCount * .01) + i * map(mouseX, 0, width, 0, 5));
		var y = height / 2 + osc * abs(mouseY - height / 2);
		stroke(150);
		strokeWeight(2.1 - (osc * 2));
		line(x, y, x, 0);
		noStroke();
		ellipse(x, y, s, s);
	}
}

