var s = 50.0;
var sMin = 25;
var sg = 2;
var x = 0.0;
var y = 0.0;
var nx = 0.0;
var ny = 0.0;
var nxv = 0.006;
var nyv = 0.005;

function setup() {
	createCanvas(windowWidth, windowHeight);
	noCursor();
	nx = random(width);
	ny = random(height);
	background(20);
	pixelDensity(1);
}

function draw() {
	x = floor(noise(nx)*width);
	y = floor(noise(ny)*height);
	fill(255);
	if(mouseIsPressed){
		s += sg;
	}else{
		s -= sg;
		if(s < sMin)
			s = sMin;
	}

	ellipse(x, y, s, s);

	nx += nxv;
	ny += nyv;
}

function keyPressed(){
	if(keyCode == 8)
		background(0);
}

/*	typeScale // cc teddavis.org 2019	*/

function setup() {
  createCanvas(windowWidth, windowHeight);
}

function draw() {
  background(0);
  fill(255);
  stroke(255);
  textSize(mouseX);
  var myText = "P5LIVE";
  textFont("Monaco");
  text(myText, 0, mouseY);
  var tw = textWidth(myText);
  var ta = textAscent()/2;
  var lc = 10;
  for(var i=0; i < lc; i++){
    var y = map(i, 0, lc-1, 0, mouseY-ta);
    var y2 = map(i, 0, lc-1, height, mouseY);
    stroke(255);
    line(0, y, width, y);
    line(0, y2, width, y2);
    line(tw, 0, tw, height);
    stroke(255, 0, 0);
    line(mouseX, 0, mouseX, height);
    line(0, mouseY, width, mouseY);
  }
}

