var mic;
var pause = false;

function setup() {
  createCanvas(windowWidth, windowHeight);
  mic = new p5.AudioIn();    
  mic.start();
}

function draw(){
  noStroke();
  fill(255, 10);
  rect(0, 0, width, height);

  fill(255);
  rect(0, height-50, width, 50);
  fill(0);
  textSize(50);
  var audio = mic.getLevel()*1000;
  text("mic: "+audio, 0, height-10);
  rect(0, height-50, map(audio, 0, 500, 0, width), -50);
}

function keyPressed(){
	if(keyCode == 32){
		pause = !pause;
		if(pause){
			mic.stop();
		}else{
			mic.start();      
		}    
 	} 

}

