var mic;
function setup() {
  createCanvas(windowWidth, windowHeight, WEBGL);
  mic = new p5.AudioIn();    
  mic.start();
}

function draw(){
  background(255);
  rotateX(radians(frameCount*0.5));
  rotateY(radians(frameCount));
  noFill();
  stroke(0);
  sphere(mic.getLevel()*1000);
  fill(255);
  sphere(mouseY*2);
}
